subSubSection.paragraph:
Diagnosis
. White scales on cephalothorax and around eyes, no clypeal mat of hairs (separating it from 

P. pallida

), square brown end to abdomen, male copulatory organs without well-developed prolateral distal tegular lobe (separating it from 

P. basilonesa

), female copulatory organs with proximal seminal ducts coiled anterior to spermatheca (separating it from 

P. basilonesa

and 

P. pallida

).
